import igraph
from tools import hard_solver
from random import randint
from random import sample
from multiprocessing import Pool

n = 7
EXEC = 100 #number of times we do sample tests
savefile = '2-2-3_gadgets/data/quick-randomization.txt'
test_range = range(1, 1000, 1)
#test_range = range(1, 50, 1)

#apparently a bijection will be necessary...
def nodeID(i,j):
    return i*n + j

def coordinates(v):
    return v//n, v%n

def gen_matrix():
    g = igraph.Graph(n**2)
    lay = [coordinates(v) for v in range(n**2)]
    labels = [str(idx) for idx in lay] 
    for i in range(n):
        for j in range(n):
            g.add_edge(nodeID(i,j), nodeID((i+1)%n,j))
            g.add_edge(nodeID(i,j), nodeID(i,(j+1)%n))
            if i%2==0 and j%2==0:
                g.add_edge(nodeID(i,j), nodeID((i+1)%n,(j+1)%n))
            if i%2==0 and j%2==1:
                g.add_edge(nodeID(i,j), nodeID((i-1)%n,(j+1)%n))

    Adj = g.get_adjacency()
    with open('adj_grid.txt', 'w') as f:
        for l in Adj:
            f.write(str(l)+',')

