def quick_task(p):
    """sample EXEC times at probability p of nodes."""
    input = [2]*n**2
    failure = 0
    p = p/1000
    for test in range(EXEC):
        testinput = False
        while testinput == False:
            winners = sample(range(n**2), int(p*(n**2))) #winners have been selected.
            for winner in winners:
                input[winner] = randint(0,1)
            testinput=hard_solver(input, M, n**2,mode = 'random-input', problem='3-2-5')
        t = hard_solver(input, M, n**2, mode ='random', problem = '3-2-5')
        if t == False:
            failure+=1
    with open(savefile, 'a') as f:
        f.write(str(p)+ ','+str(failure/EXEC)+','+str(failure)+'\n')
        
def parallel_task():
    p = Pool(3)
    p.map(quick_task, test_range)

parallel_task()

